import React, { useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import {
  Elements,
  useStripe,
  useElements,
  CardElement,
} from "@stripe/react-stripe-js";
import { loadStripe } from "@stripe/stripe-js";
import axios from "axios"; // Import axios
import "./Checkout.css";

// Initialize Stripe
const stripePromise = loadStripe(
  "pk_test_51NdsQCEBmpPY3F1SVvoq27xazI7MPxe38i9q9otPfxTR61SRhYaUZHvDjxnvWl8VuriA1QFiQVkqKGitEzYcR2Ha00yiiOOlzY"
);

const Checkout = () => {
  const navigate = useNavigate();
  const stripe = useStripe();
  const elements = useElements();
  const location = useLocation();
  const { selectedPlan } = location.state || {};

  // State for user details
  const [cardholderName, setCardholderName] = useState("");
  const [email, setEmail] = useState("");
  const [loading, setLoading] = useState(true);

  // Fetch user details from MongoDB
  useEffect(() => {
    if (!selectedPlan) {
      navigate("/subscription-plans");
    }

    const fetchUserDetails = async () => {
      try {
        const token = localStorage.getItem("authToken"); // Ensure the user is authenticated
        const response = await axios.get("http://localhost:3001/api/users/me", {
          headers: { Authorization: `Bearer ${token}` },
        });

        const userData = response.data;
        setCardholderName(userData.name);
        setEmail(userData.email);
        setLoading(false);
      } catch (error) {
        console.error("Error fetching user details:", error);
        setLoading(false);
      }
    };

    fetchUserDetails();
  }, [selectedPlan, navigate]);

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!stripe || !elements) {
      return;
    }

    const cardElement = elements.getElement(CardElement);
    const { token, error } = await stripe.createToken(cardElement);

    if (error) {
      alert("Payment failed: " + error.message);
    } else {
      try {
        const response = await axios.post(
          "http://localhost:3001/api/payment-intent",
          {
            token: token.id,
            cardholderName,
            email,
            selectedPlan,
          }
        );

        if (response.status === 200) {
          alert("Payment successful!");
          navigate("/");
        } else {
          alert("Payment failed: " + response.data.error);
        }
      } catch (err) {
        alert("Payment failed.");
      }
    }
  };

  return (
    <div className="checkout-container">
      <h2 className="checkout-header">Checkout</h2>
      <h3 className="selected-plan-name">{selectedPlan?.name}</h3>
      <p className="plan-description">{selectedPlan?.description}</p>

      {loading ? (
        <p>Loading user details...</p>
      ) : (
        <form onSubmit={handleSubmit} className="checkout-form">
          <div className="credit-card-details">
            <div className="input-group">
              <label>Cardholder Name:</label>
              <input
                type="text"
                value={cardholderName}
                onChange={(e) => setCardholderName(e.target.value)}
                required
              />
            </div>

            <div className="input-group">
              <label>Email:</label>
              <input
                type="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
              />
            </div>

            <div className="input-group">
              <label>Card Details:</label>
              <CardElement />
            </div>
          </div>

          <div className="submit-button">
            <button type="submit" disabled={!stripe}>
              Pay Now
            </button>
          </div>
        </form>
      )}
    </div>
  );
};

const CheckoutWrapper = () => (
  <Elements stripe={stripePromise}>
    <Checkout />
  </Elements>
);

export default CheckoutWrapper;
